import React from "react";
import { Outlet, Link } from "react-router-dom";


const Home = () => {
    return (
        <>
            <header className="sans-serif">
                <div className="cover bg-left bg-center-l" style={{backgroundImage: `url('http://mrmrs.github.io/photos/u/011.jpg')`}}>
                    <div class="bg-black-80 pb5 pb6-m pb7-l">
                        <nav className="fixed dt w-100 mw8 center">
                            
                            <Link className="f6 fw4 hover-white no-underline white-70 dn dib-ns pv2 ph3" to="/App" title="App">App</Link>
                            <Link className="f6 fw4 hover-white no-underline white-70 dn dib-ns pv2 ph3" to="/Login" title="Login">Login</Link>
                            <Link className="f6 fw4 hover-white no-underline white-70 dn dib-ns pv2 ph3" to="/Signup" title="Signup">Signup</Link>
                            <Link className="f6 fw4 hover-white no-underline white-70 dn dib-ns pv2 ph3" to="/App" title="App">App</Link>
                        </nav>
                    </div>
                </div>
            </header>
            <Outlet />
        </>
    );
}

export default Home;
